description:
Can you keep the water clean? In this twitch-based, action-puzzle game, you'll be stopping (or avoiding) the toxic, polluting MonstaFish! Four different puzzle modes keep the game fresh and challenging. Fish Hook Mode will have you avoiding MonstaFish traffic. Show off your sharpshooter skills in Fish Hunt. Blast waves of MonstaFish with Time Attack. And, finally, use bubbles to deflate evolved MonstaFish and remove pollution in MonstaFish mode! With beautiful graphics, great sounds and a theme tune that will get in your head these deep waters are guaranteed to pull you under! Play it today!
